import React from "react";
import {Card,Avartar,Button} from 'antd';


const UserProfile=()=>{
    return(
        <Card
            actions={[
                <div key="twit">짹쨱<br/>0</div>,
                <div key="followings">followings<br/>0</div>,
                <div key="followings">followings<br/>0</div>,
            ]}
        >
            <Card.Meta
                title="PickMe"
                avatar={<Avartar>PM</Avartar>}
            />
            <Button>로그아웃</Button>
        </Card>


    );
}


export default UserProfile;
